import React from "react";
import { Route, Switch } from "react-router-dom";
import HomePage from "../pages/HomePage";

function index(props) {
  return (
    <Switch>
      <Route exact path="/">
        <HomePage />
      </Route>
    </Switch>
  );
}
export default index;
